    used in the April 2003 Quarterly report.  This has caused Column B totals to be
    incorrect. The April 2003 Quarterly report will be amended to reflect the correct
    allocation percentages.  Salary and wages were reported on line 21b of this report.
    The employees paid these wages spent less then 25% of their time on federal election
    activity.\tScheduled B- supporting Line 21(b) discloses payment(s) totaling $54,666.49
    for Direct Mail Piece, Postage-Direct Mail, Printing Direct, and Telemarketing
    Fundraising.  These expenditures for public communications did not refer to a
    clearly identified candidate for federal office or promote, support, attack or
    oppose any candidate for federal office. These communications did not meet the
    definition of federal election activity. \tSchedule H4 supporting line 21(a) of
    this report discloses payments for Employee Health Ins, Payroll Taxes, Salary,
