    Opinion 2003-11 which disallowed the allocation of employee fringe benefits.\tScheduled
    B- supporting Line 21(b) discloses payment(s) for Advertising, Postage Machine,
    Postage, Postage Deposit, New Phones for Office, Quarterly Payment on Postage
    Machines, Telephone Expense, Telephone Service and Telephone-Expense Conference
